import { NavLink } from 'react-router-dom';

function BarraNavegacao() {
  return (
    <nav className="bg-pink-500 p-4">
      <ul className="flex justify-around">
        <li><NavLink to="/quiz" activeClassName="font-bold">Quiz Personalizado</NavLink></li>
        <li><NavLink to="/mapa" activeClassName="font-bold">Mapa Interativo</NavLink></li>
        <li><NavLink to="/carta" activeClassName="font-bold">Carta 3D</NavLink></li>
        <li><NavLink to="/surpresa" activeClassName="font-bold">Surpresa Final</NavLink></li>
      </ul>
    </nav>
  );
}

export default BarraNavegacao;
